import React from "react";
import "./styles.css";
import Navbar from "./Navbar";
import Accordian from "./Accordian";
import HomeSlider from "./HomeSlider";
import Footer from "./Footer";

function Vlanding() {
  return (
    <>
   <Navbar/>
   <HomeSlider/>
<Accordian/>
<Footer/>

    </>
  );
}

export default Vlanding;
